css:
:root {
  font-size: 16px;
}
.atom-ts-documentation > div,
atom-ts-reference > div > div {
  max-height: 180px;
  overflow-y: auto;
}
.atom-ts-documentation {
  position: absolute;
  right: calc(10.5rem);
  background: rgba(32, 33, 35, 0.9);
  border: 1px solid rgba(0, 0, 0, 0.2);
  color: rgba(171, 178, 191, 0.8);
  border-radius: 0.125rem;
  width: 40%;
  min-height: 180px;
  max-width: 640px;
  opacity: 0;
  pointer-events: none;
  transition: opacity .2s ease;
}
.atom-ts-documentation ::-webkit-scrollbar {
  width: 8px;
  height: 8px;
}
.atom-ts-documentation ::-webkit-scrollbar-track,
.atom-ts-documentation ::-webkit-scrollbar-corner {
  background: transparent;
}
.atom-ts-documentation ::-webkit-scrollbar-thumb {
  background: rgba(0, 0, 0, 0.1);
  border-radius: 5px;
  box-shadow: 0 0 1px black inset;
}
.atom-ts-documentation.active {
  opacity: 1;
  pointer-events: auto;
}
.atom-ts-documentation.top {
  top: calc(36.5rem);
}
.atom-ts-documentation.middle {
  top: calc(50% -  90px);
}
.atom-ts-documentation.bottom {
  bottom: calc(26.5rem);
}
.atom-ts-documentation h2 {
  margin: 0;
  line-height: 1.4em;
  margin-top: -0.2em;
}
.atom-ts-documentation p {
  margin-top: 10px;
}
.atom-ts-documentation p > span {
  display: block;
  padding-top: 4px;
}
.atom-ts-documentation .link {
  cursor: pointer;
  color: rgba(171, 178, 191, 0.6);
}
.atom-ts-documentation .link:hover {
  text-decoration: underline;
}
